import it from './listItems.module.css'




function Listitem(props) {



props.todos
    return (

        <div className={it.mapValue} >

            {todos.map((todo) => {
                return (

                    <div  className={it.todo_item} key = {todo.id}>

                        <input id ={todo.id} className={it.checkbox} type="checkbox" 
                        checked = {todo.isCompleted} onChange = {(e)=>{
                           onChange ({
                            ...todo,
                            isCompleted: e.target.checked
                           })
                        }}

                        />
                        <label className={it.check} htmlFor = {todo.id}></label>
                        <div>{todo.text}</div>

                    </div>
                )
            })}
        </div>
    )
}
export default Listitem
